import{_ as e}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as i,c as o,e as t}from"./app.76d538f0.js";const a={},r=t('<h3 id="why-can-t-i-preview-the-video-or-audio-file" tabindex="-1"><a class="header-anchor" href="#why-can-t-i-preview-the-video-or-audio-file" aria-hidden="true">#</a> Why can&#39;t I preview the video or audio file?</h3><ul><li>Requires a browser-supported encoding</li><li>General browsers do not support h265 encoded video</li><li>General browsers do not support ac3 encoded audio</li></ul><p>In particular, for Safari:</p><ul><li>For cross-origin media, content-type must be the media type, not the generic application/octet-stream. So if the content-type returned by the direct link is application/octet-stream, then Safari will not be able to play.(PS: Why Can AliyunDirve play in Safari? Because the official website of the video playback is not the use of download links, but after the transcoding of AliyunDirve)</li></ul><h3 id="why-can-t-i-preview-the-office-file" tabindex="-1"><a class="header-anchor" href="#why-can-t-i-preview-the-office-file" aria-hidden="true">#</a> Why can&#39;t I preview the office file?</h3><p>For microsoft office online viewers, you need:</p><ul><li>External network access</li><li>The document access address cannot use ip directly, it needs to be accessed through a domain name, and the port must be port 80 / 443</li><li>The format of the document (must be one of the following):</li><li>Word: docx, docm, dotm, dotx</li><li>Excel: xlsx, xlsb, xls, xlsm</li><li>PowerPoint: pptx, ppsx, ppt, pps, pptm, potm, ppam, potx, ppsm</li><li>Document size: Word and PowerPoint documents must be less than 10 megabytes; Excel must be less than five megabytes</li></ul><h3 id="why-can-t-i-preview-the-pdf-file" tabindex="-1"><a class="header-anchor" href="#why-can-t-i-preview-the-pdf-file" aria-hidden="true">#</a> Why can&#39;t I preview the PDF file?</h3><ul><li>We use <code>pdf.js</code> as the default PDF previewer. So it requires https+cors.</li><li>https is opened for yourself, reverse proxy or provide a certificate in the configuration file</li><li>cors provides support for related cloud disks and cannot be modified by yourself unless the agent is turned on to use the program to transfer</li></ul><h3 id="why-can-t-package\u200B-download" tabindex="-1"><a class="header-anchor" href="#why-can-t-package\u200B-download" aria-hidden="true">#</a> Why can&#39;t package\u200B download?</h3><p>Same as pdf preview, requires https+cors support,and:</p><ul><li>AList use stream API of browser to support package download, so it requires browser support. Usually, it is supported by new browsers, such as Chrome, Firefox, Edge, etc.</li></ul><h3 id="why-does-it-shows-uploading-in-the-backend-when-i-upload-a-file" tabindex="-1"><a class="header-anchor" href="#why-does-it-shows-uploading-in-the-backend-when-i-upload-a-file" aria-hidden="true">#</a> Why does it shows <code>Uploading in the backend</code> when I upload a file?</h3><ul><li>All uploads of this program use server transfer</li></ul><h3 id="why-do-i-get-413-http-code-when-i-upload-a-file" tabindex="-1"><a class="header-anchor" href="#why-do-i-get-413-http-code-when-i-upload-a-file" aria-hidden="true">#</a> Why do i get <code>413</code> http code when i upload a file?</h3><ul><li>If you use a reverse proxy, you may need to specify the maximum upload file size and timeout in the configuration</li><li>Otherwise, it may happen that the upload is successful but the front end times out and there is no response</li></ul><h3 id="why-can-t-i-download-files-after-add-aliyundirve-storage-and-get-invalidargument-error" tabindex="-1"><a class="header-anchor" href="#why-can-t-i-download-files-after-add-aliyundirve-storage-and-get-invalidargument-error" aria-hidden="true">#</a> Why can&#39;t I download files after add <code>AliyunDirve</code> storage and get <code>InvalidArgument</code> error?</h3><ul><li>Due to referrer restrictions, mobile tokens must be used if you don&#39;t open any proxy.</li></ul>',18),d=[r];function n(s,l){return i(),o("div",null,d)}const p=e(a,[["render",n],["__file","why.html.vue"]]);export{p as default};
